// https://leetcode.com/problems/map-of-highest-peak/

/**
 * @param {number[][]} isWater
 * @return {number[][]}
 */
var highestPeak = function(isWater) {
  let r = isWater.length
  let c = isWater[0].length

  let visited = Array(r).fill().map(() => Array(c).fill(false))

  let q = []
  for (let i = 0; i < r; i++) {
    for (let j = 0; j < c; j++) {
      if (isWater[i][j] == 1) {
        console.log(i, j)
        q.push([i, j])
        visited[i][j] = true
        isWater[i][j] = 0
      }
    }
  }

  let paths = [[1, 0],[-1, 0],[0, 1],[0, -1]]

  const isValid = (i, j) => {
    // out of bounds
    if (i >= 0 && j >= 0 && i < r && j < c && isWater[i][j] == 0) {
      return true
    }
    return false
  }

  let i = 0
  while(i < q.length) {
    console.log(q)
    let [x, y] = q[i++]
    let newHeight = isWater[x][y] + 1
    for (let p of paths) {
      let n_x = x + p[0]
      let n_y = y + p[1]
      if (isValid(n_x, n_y)) {
        
        if (!visited[n_x][n_y]) {
          isWater[n_x][n_y] = newHeight
          visited[n_x][n_y] = true
          q.push([n_x, n_y])
        }
      }
    }
  }
  return isWater
};

